import Test from '@/components/test'
import Login from '@/views/Login'
import Main from '@/views/Main'
import React from 'react'
import Home from '@/components/main/Home'
import My from '@/components/main/My'
import Task from '@/components/main/Task'
import {HomeOutlined,UserOutlined,CopyOutlined } from '@ant-design/icons'
/**
 * 路由表
 * @param {*} path:地址
 * @param {*} name:名称
 * @param {*} component:组件
 * @param {*} isAuth:是否需要登录权限
 */
 const routerMap= [
  {path:'/',name:'测试',component:Test,isAuth:true,exact:true},
  {path:'/login',name:'登录',component:Login,isAuth:false,exact:true},
  {path:'/main/:type',name:'主要的',component:Main,isAuth:true,exact:false}
]
/**
 * main页面，的值
 * @param {*} type:类型
 * @param {*} title:标题
 * @param {*} headerName:
 * @param {*} icon:是否需要登录权限
 * @param {*} component:显示的主页面的组件
 */
export const mainPageMap=[
  {
    type:'home',
    title:"首页",
    headerName:"首页",
    icon:()=>(
      <HomeOutlined className="mainIcon"/>
    ),
    component:()=>(
      <Home/>
    )
  },
  {
    type:'task',
    title:"任务",
    headerName:"任务列表",
    icon:()=>(
      <CopyOutlined className="mainIcon"/>
    ),
    component:()=>(
      <Task/>
    )
  },
  {
    type:'my',
    title:"我的",
    headerName:"个人中心",
    icon:()=>(
      <UserOutlined className="mainIcon"/>
    ),
    component:()=>(
      <My/>
    )
  }
]
export const mainTypeMatch=(type)=>{
  return mainPageMap.find(res=>{
    return res.type===type
  })
}

export default routerMap
